How to get associated document who satisfy match object<p>In the following query, I want to fetch all verified students and their related meetings. but Trying to fetch all upcoming meetings which means meetings having at least one future date time. My writtten query fetches all verified students but also fetches all the meetings of a student including past one. I want a student to be fetched only if it has any upcoming meetings and fetch only upcoming meetings in returning association. And I want to sort client array of objects according to nearest meeting Any help will be greatly appreciated</p>
<pre><code>     let aggregateDataQuery = [
        {
          $lookup: {
            from: 'meetup',
            localField: '_id',
            foreignField: 'studentId',
            as: 'meetup',
          },
        },
        {
          $project: {
            firstName: 1,
            lastName: 1,
            email: 1,
            meetup: {
              _id: 1,
              startTime: 1,
            },
          },
        },
      ];

      const [result, err] = await of(
        Student.aggregate([
          ...aggregateDataQuery,
          { $match: { 
          verified: true,
              'meetup.startTime': { '$gte': 2021-09-10T08:41:15.746Z }
           } 
          },
          {
            $facet: {
              data: [
                { $sort: sortBy },
                { $skip: skip },
                { $limit: recordLimit },
              ],
              count: [
                {
                  $count: 'count',
                },
              ],
            },
          },
        ])
      );
</code></pre>

