Is there an easy way to pass a document property as argument list to operators like $setEquals?<p>The <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/setEquals/" rel="nofollow noreferrer"><code>$setEquals</code></a> aggregation pipeline operator has the following interface:</p>
<pre><code>{ $setEquals: [ &lt;expression1&gt;, &lt;expression2&gt;, ... ] }
</code></pre>
<p>Now after a few <code>$group</code> stages I have a document like this:</p>
<pre><code>{ myLists: [[...], [...], [...]] }
</code></pre>
<p>And would like to check if all those sub-arrays contain the same values, so pass it to <code>$setEquals</code>:</p>
<pre><code>{ $setEquals: '$myLists' }
</code></pre>
<p>but mongo complains: <code>$setEquals needs at least two arguments had: 1</code>.</p>
<p>If I know the number of elements, I can just pass them explicitly:</p>
<pre><code>{ $setEquals: [{ $arrayElemAt: ['$myLists', 0] }, { $arrayElemAt: ['$myLists', 1] }] }
</code></pre>
<p>If I don't know the number, I can use <code>$reduce</code> to do it sort-of element-wise, but this requires the empty set as an indicator for &quot;false&quot;:</p>
<pre><code>{
  $reduce: {
    input: '$myList',
    initialValue: { $arrayElemAt: ['$myList', 0] },
    in: {
      $cond: {
        if: { $setEquals: ['$$value', '$$this'] },
        then: '$$value',
        else: [],
      },
    },
  },
}

</code></pre>
<p>Is there a better way?</p>

