JSON data getting retrieved from mongodb with formats added explicitly inside field e.g.({"field": {$numberInt: "20"}}). How to process that data?<p>I have used mongo import to import data into mongodb from csv files. I am trying to retrieve data from an Mongodb realm service. The returned data for the entry is as follows:</p>
<pre><code>{
       &quot;_id&quot;: &quot;6124edd04543fb222e&quot;,
       &quot;Field1&quot;: &quot;some string&quot;,
       &quot;Field2&quot;: {
         &quot;$numberDouble&quot;: &quot;145.81&quot;
       },
       &quot;Field3&quot;: {
         &quot;$numberInt&quot;: &quot;0&quot;
       },
       &quot;Field4&quot;: {
         &quot;$numberInt&quot;: &quot;15&quot;
       },
       &quot;Field5&quot;: {
        &quot;$numberInt&quot;: &quot;0&quot;

     } 
</code></pre>
<p>How do I convert this into normal JSON by removing $numberInt and $numberDouble like :</p>
<pre><code>{
       &quot;_id&quot;: &quot;6124edd04543fb222e&quot;,
       &quot;Field1&quot;: &quot;some string&quot;,
       &quot;Field2&quot;: 145.8,
       &quot;Field3&quot;: 0,

       &quot;Field4&quot;: 15,

       &quot;Field5&quot;:  0

     } 
</code></pre>
<p>The fields are also different for different documents so cannot use Mongoose directly. Are there any solutions to this?
Also would help to know why the numbers are being stored as $numberInt:&quot;&quot;.</p>
<h2><strong>Edit:</strong></h2>
<p>For anyone with the same problem this is how I solved it.</p>
<p>The array of documents is in EJSON format instead of JSON like said in the upvoted answer. To covert it back into normal JSON, I used JSON.stringify to first convert each document I got from map function into string and then parsed it using EJSON.parse with</p>
<p><strong>{strict:false} (<em>this option is important</em>)</strong></p>
<p>option to convert it into normal JSON.</p>
<pre><code>{restaurants.map((restaurant) =&gt; {
          restaurant=EJSON.parse(JSON.stringify(restaurant),{strict:false});
}
</code></pre>
<p>EJSON.parse <a href="https://yarnpkg.com/package/mongodb-extjson" rel="nofollow noreferrer">documentation</a> here. The module to be installed and imported is mongodb-extjson.</p>

