Performance implication of (mongo.Client).Ping<p>Ive recently noticed some odd behavior while testing the performance of writing or reading to a MongoDB serveless cluster.</p>
<p>I dont think is related to the serverless option, but as a context Im using a new serverless cluster in AWS (Ireland region) which I interact with from my local machine.</p>
<p>Some demo code:</p>
<pre class="lang-golang prettyprint-override"><code>package main

import (
    &quot;context&quot;
    &quot;fmt&quot;
    &quot;log&quot;
    &quot;time&quot;

    &quot;go.mongodb.org/mongo-driver/mongo&quot;
    &quot;go.mongodb.org/mongo-driver/mongo/options&quot;
)

type Item struct {
    Value string `bson:&quot;value&quot;`
}

func main() {
    ctx := context.Background()
    client, err := mongo.Connect(ctx, options.Client().ApplyURI(&quot;add-url&quot;))
    if err != nil {
        log.Fatalln(err)
    }

    err = client.Ping(ctx, nil)
    if err != nil {
        log.Fatalln(err)
    }

    collection := client.Database(&quot;test&quot;).Collection(&quot;test&quot;)
    item := Item{
        Value: &quot;foo&quot;,
    }
    start := time.Now()
    _, err = collection.InsertOne(ctx, item)
    if err != nil {
        log.Fatalln(err)
    }

    fmt.Println(&quot;Item added in&quot;, time.Since(start))
}
</code></pre>
<p>This works fine, producing results of about 60ms consistently.</p>
<p>However, if I remove the <code>err = client.Ping(ctx, nil)</code> part the times jump to over 500ms consistently. Why does this happen?</p>
<p>Not much info I get from <a href="https://pkg.go.dev/go.mongodb.org/mongo-driver/mongo#Client.Ping" rel="nofollow noreferrer">the docs</a>.</p>

