Defining Mongoose Schema with createdAt variable using new Date() doesnt work<p>I am a newbie learner to MERN stack, in my server side I created a createRecord function as below:</p>
<pre><code>export const createRecord = async (req, res) =&gt; {
   const { person_name, person_position, person_level } = req.body;
   const newRecordItem = new RecordItem({
    person_name,
    person_position,
    person_level,
  });
</code></pre>
<p>As I understand, newRecordItem makes a RecordItem object which is a mongoose model as below:</p>
<pre><code>const itemSchema = mongoose.Schema({
  person_name: String,
  person_position: String,
  person_level: String,
  createdAt: {
    type: Date,
    default: new Date(), //this only returns one specific time which is server start time
  },
});

var RecordItem = mongoose.model(&quot;recorditem&quot;, itemSchema);
</code></pre>
<p>In this structure, when I create a new record its created_At variable always returns when server is up time for new created records not when actually created.</p>
<p><a href="https://i.stack.imgur.com/GgCA2.png" rel="nofollow noreferrer">example</a></p>
<p>My solution to this, simply sending Date value in createRecord function and removing default Date value in schema. But why schema only returns one time value at the first structure above.</p>
<p>This works as intended:</p>
<pre><code>export const createRecord = async (req, res) =&gt; {
  const { person_name, person_position, person_level } = req.body;
  const createdAt = new Date();

  const newRecordItem = new RecordItem({
    person_name,
    person_position,
    person_level,
    createdAt,
  });
</code></pre>
<p>And the schema:</p>
<pre><code>const itemSchema = mongoose.Schema({
  person_name: String,
  person_position: String,
  person_level: String,
  createdAt: Date,
});
</code></pre>

